import React, { Component } from 'react';
import { Link } from 'react-router-dom';

//import '../Stylesheets/materialize.css';
class Header extends Component{
    render(){
        const cartItemQuantity = '';
        const cartWithQuantity = `Cart (${cartItemQuantity})`;
        return (
            <nav className="nav-wrapper">
                <div className="container">
                    <Link to="/" className="brand-logo">Shopping</Link>
                    <ul className="right">
                        <li><Link to="/">Products</Link></li>
                        <li><Link to="/cart">{cartWithQuantity}</Link></li>
                    </ul>
                </div>
            </nav>
        );
    }
}

const mapStateToProps = state => {
    return {
        items: state.items,
        cartQuantity: state.cartQuantity,
        isLoading: state.isLoading,
        error: state.error,
    }
}

const mapDispatchToProps = dispatch => {
    return {
        responseFromApi: data => dispatch(responseFromApi(data)),
        failedToFetchApiResponse: error => dispatch(failedToFetchApiResponse(error)),
        addProductToCart: id => dispatch(addProductToCart(id))
    }
}
export default connect(mapStateToProps)(Header);
